export function Emojis({istEmj}) {
return (
    <div className="flex items-center justify-start" style={{flexWrap: "wrap", gap:"1.1rem"}}>
        {emjs.map((it:any, id:number)=>
        <div key={id} className="cursor-pointer" onClick={()=>istEmj(Object.keys(it)[0])}>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 36 36" className="w-7 h-7" >
                {it[Object.keys(it)[0]]}
            </svg>
        </div>
        )}
    </div>
)}

export function Emoji(name: string) {
    const r:any = emjs.find((it:any)=>it.hasOwnProperty(name))
    return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 36 36" className="w-7 h-7">
        {r[Object.keys(r)[0]]}
    </svg>
)}

export function insetEmoji(content: string): any {
    if (!content || content.trim().length <= 0) {
        return "";
    }
    let reg = /\[.*?\]/g; 
    let rgArr = content.match(reg);
    const rets=[]
    let str = content
    if (rgArr && rgArr.length > 0) {
        for(const item of rgArr){            
            let w = item.replace(/^\[|\]$/gi, "");
            let a = str.split(item)
            if(a[0]===''){
                const r:any = emjs.find((it:any)=>it.hasOwnProperty(w))
                if(r)
                rets.push(<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 36 36" className="w-7 h-7 mx-2">
                    {r[Object.keys(r)[0]]}
                </svg>)
            }else{
                rets.push(a[0])
                const r:any = emjs.find((it:any)=>it.hasOwnProperty(w))
                if(r)
                rets.push(<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 36 36" className="w-7 h-7 mx-2">
                    {r[Object.keys(r)[0]]}
                </svg>)
            }
            str=a[1]
        }
        if(str!='')
            rets.push(str)
        return rets
    }else
        return [content]
}


